script: |
  super -f text -I q349.spq | sort > q349.out

inputs:
  - name: q349.spq
    data: |
      SELECT DISTINCT col2 + - 29 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT + + 98 BETWEEN - CAST ( - - col0 AS INTEGER ) AND ( + - col1 * - ( - col1 ) + - col0 );
  - name: tab0

outputs:
  - name: q349.out
    data: |
      -19
      18
      70
